import React from 'react';
import './App.css';
import List from '@material-ui/core/List';
import { mainListItems } from './Components/elementos';
import tablaLista from './Components/tabla'

import Title from './Components/title';
import Orders from './Components/tabla';

function App() {
  return (
    <div className="App">
      <Title children="este es el titulo"/>
      <List>{mainListItems}</List>
      <Orders/>
    </div>
  );
}

export default App;
